import React from 'react';

const Footer = () => {
  return (
    <footer className="main-footer" style={{ backgroundColor: 'black' }}>
      <strong>
        Copyright &copy; 2017{' '}
        <a href="https://www.tutorialesatualcance.com" target="_blank" rel="noopener noreferrer">
          Tutoriales a tu Alcance
        </a>
        .
      </strong>
      <span> Todos los derechos reservados.</span>
    </footer>
  );
};

export default Footer;
